import acm from '../assets/images/acm.png';
import lca from '../assets/images/lca.png';
import rov from '../assets/images/rover.png';

export const AboutData = [
    {
        title: "ACM Web",
        timeframe: "Aug 2021 - Present",
        role: "Front-End Developer",
        image: {acm},
        bullets: [
            "Utilize React.js to create front-end features as a team of developers.",
            "Fixed front-end event date formatting issue on the ACM production site.",
            "Learned about virtualizatioon with Docker."
        ]
    },
    {
        title: "Lambda Chi Alpha",
        timeframe: "Jan 2022 - Present",
        role: "Secretary",
        image: "Image",
        bullets: [
            "Manage Outlook calendars, Outlook groups, and Slack",
            "Regularly update spreadsheets and statuses of members using Google Sheets and OmegaFi",
            "Communicate with all members of the Fraternity including all officcers and chapter advisors."
        ]
    },
    {
        title: "Mars Rover Design Team",
        timeframe: "Aug 2020 - Jan 2021",
        role: "Autonomous Programmer",
        image: "Image",
        bullets: [
            "Developed search pattern and navigation algorithms as a member of the autonomy sub team.",
            "Wrote autonomous rover detection and navigation Python programs that allowed the rover to naviggate itself around a detected obstacle.",
            "Gained experience using Git and Pipenv."
        ]
    }
]
